function App() {
  const data = [{id:'1',title: "book", cost:100, date: new Date(2022,2,25)},
  {id:'2',title: "pen", cost:10, date: new Date(2022,2,26)},
  {id:'3',title: "bench", cost:1000, date: new Date(2022,2,27)}];
  return (
    <div>
      <h2>React Proj!!</h2>
      <ExpensesItem date={data[0].date} cost={data[0].cost} title={data[0].title}></ExpensesItem>
      <ExpensesItem date={data[1].date} cost={data[1].cost} title={data[1].title}></ExpensesItem>
      <ExpensesItem date={data[2].date} cost={data[2].cost} title={data[2].title}></ExpensesItem>
    </div>
  );
}

export default App;
